import React from 'react';

import DeleteIcon from '@material-ui/icons/Delete';

const List = (props)=>{
    const deleteit = ()=>{
        const line = {color : 'red'};
        return line;
    }
    return(
        <>
            <div id="ListDiv">
            <span onClick={deleteit}> <DeleteIcon id="Delbtn"/> </span>
            <list id="list" style={line}> {props.item} </list>
            </div>
        </>
    )
}   

export default List;
